SELECT * FROM (WITH
  elec_before AS (select s.MPXN, s.MSN, s.supplyStatus, s.ambiguous_meter, 'elec' fuel
from `data-engineering-prod.landing_andromeda_secure.spam_d_minus_1_electricity_mapping` s),
  gas_before AS (select s.MPXN, s.MSN, s.supplyStatus, s.ambiguous_meter, 'gas' fuel
from `data-engineering-prod.landing_andromeda_secure.spam_d_minus_1_gas_mapping` s),
before AS (SELECT * FROM elec_before UNION ALL SELECT * FROM gas_before),

  elec_after AS (select s.MPXN, s.MSN, s.supplyStatus, s.ambiguous_meter, 'elec' fuel
from `data-engineering-prod.landing_andromeda_secure.spam_current_electricity_mapping` s),
  gas_after AS (select s.MPXN, s.MSN, s.supplyStatus, s.ambiguous_meter, 'gas' fuel
from `data-engineering-prod.landing_andromeda_secure.spam_current_gas_mapping` s),
after AS (SELECT * FROM elec_after UNION ALL SELECT * FROM gas_after)

SELECT after.*,
  if(before.MSN != after.MSN, true, false) mapping_change,
  if(before.supplyStatus != after.supplyStatus, true, false) status_change,
  if(before.ambiguous_meter != after.ambiguous_meter, true, false) ambiguous_meter_change
  FROM before, after
  WHERE before.MPXN = after.MPXN)
